import TopNav from './TopNav';
import MiddleNav from './MiddleNav';
import Container from 'react-bootstrap/Container';

function Nav() {
  return (
    <header>
      <Container fluid style={{ padding: '0' }}>
        <TopNav />
        <MiddleNav />
      </Container>
    </header>
  );
}

export default Nav;
